mapper.select:
    select
    
      distinct
    
    
    from t_chnl_hyldk_log
    
      
    
    
      order by ${orderByClause}
    
    
	limit #{beginRow},#{pageSize}

    SELECT a.* 
    
      distinct
    
    FROM t_chnl_hyldk_log a WHERE 1=1
    
    
     and a.MERCHANTID=#{merchantid}
    
    
	and a.ACCOUNTNO=#{accountno}
	
	 
	and a.REQSN=#{reqsn}
	
	
	and a.RETCODE ='0000'
	
	
	and a.RETCODE !='0000'
	 
	
	and a.INTIME >=#{stime}
	
	
	and a.INTIME <#{etime}
	
    
      order by ${orderByClause}
    
    
	limit #{beginRow},#{pageSize}

    SELECT a.* 
    
      distinct
    
    FROM t_chnl_hyldk_log_bak a WHERE 1=1
    
    
     and a.MERCHANTID=#{merchantid}
    
    
	and a.ACCOUNTNO=#{accountno}
	
	 
	and a.REQSN=#{reqsn}
	
	
	and a.RETCODE ='0000'
	
	
	and a.RETCODE !='0000'
	 
	
	and a.INTIME >=#{stime}
	
	
	and a.INTIME <#{etime}
	
    
      order by ${orderByClause}
    
    
	limit #{beginRow},#{pageSize}
